import React, { useEffect, useState } from "react";
import '../css/Design.css';
import axios from "axios";
import Data from "../Data";
const Pokemon=()=>{
const [num,setNum]=useState();
const [name,setName]=useState();
const [moves,setMoves]=useState();
const [src,setSrc]=useState("data:image/png;base64,");

useEffect(()=>{
    async function Data(){
        const da=await axios.get(`https://pokeapi.co/api/v2/pokemon/${num}`);
        console.log(da);
    setName(da.data.name)
    setMoves(da.data.moves.length)

if(num==1){
setSrc("data:image/jpeg;base64,")
}
else if(num==6){
    setSrc("data:image/png;base64,")
}
else if(num==24){
    setSrc("data:image/jpeg;base64,")
}
else if(num==4){
    setSrc("data:image/png;base64,")
}
else if(num==25){
    setSrc("https://i.pinimg.com/originals/92/37/6c/92376cd31daa2b778d0c8c972f4ff15e.png")
}
}
    Data();
}

)
    return(
<div className="main">
<div className="todo-in">
    <br/>
    <br/>
    
<h1 className="head">Pokemon</h1>
<br/>
<h1 className="poke">Pokemon : <span style={{color : 'darkred'}}>{name}</span></h1>
<h1 className="poke">Moves :  <span style={{color : 'darkred'}}>{moves}</span></h1>
<img src={src} className="images" />
<br/>
<br/>
<select value={num} className="option" onChange={(e)=>{
    setNum(e.target.value)
}}>
    <option value="1">1</option>
    <option value="6">6</option>
    <option value="24">24</option>
    <option value="4">4</option>
    <option value="25">25</option>

</select>
</div>

</div>

    )
}

export default Pokemon;